        {# {{ user.roles }} #}
        {% if is_granted(\"ROLE_ADMIN\") %}
            {{ user.password }}
        {% endif %}
        {{ user.firstname }}
        {{ user.lastname }}
        {{ user.birthdate|date('Y-m-d') }}
        {{ user.creationdate|date('Y-m-d') }}

        {% if is_granted(\"ROLE_ADMIN\") %}
            <a href=\"{{ path('user_edit', {'id': user.id}) }}\">Edit</a>
            <a href=\"{{ path('user_delete', {'id': user.id}) }}\">Delete</a>
        {% endif %}
    <br>
    {% endfor %}
